import React from 'react';
import './category.css';
import { Link } from "react-router-dom";

const CategorieList = [
    'React', 
    'JavaScript', 
    'HTML', 
    "CSS"
  ]; 


const ListOfCategories = () => {

    return (
      <>
        <ul className="ul-cat-list">
          {CategorieList.map((val) => (

            <Link to={`/${val}`} >
            <li key={val}
              name={val}
             className="li-cat-list"
            >{val}</li>
             </Link>
          ))}
        </ul>
      </>
    );
  }; 

  export default ListOfCategories;
